
The DNA sample was obtained from ~4,000-year-old permafrost-preserved hair, and was shown to have very low modern DNA contamination.  The diploid genome was sequenced to an average depth of 20x using Illumina GAII sequencing platforms, with 79% recovery.  Correct indexed reads were mapped to the human genome (hg18) with a suffix array-based method that allows for residual primer trimming.  Sequencing yielded a total of 3.5 billion reads.', 251255586816, 'ftp://climb.genomics.cn/pub/10.5524/100001_101000/100026/', 'Published', 'GigaDBUploadForm_Saqqaq.xls', '8e360c1a14ca14323286e6964bafd86b', '2011/11/12', null, 1 );
